const buffer = new Uint8Array(data).buffer

describe("legacy model parsing", () => {
	it("works", () => {
		const parsed = innerParseLegacyEntityData(buffer)

		expect(parsed.soundTypes[0]).toStrictEqual(4294967295)
		expect(parsed.frameCount).toStrictEqual(10)
		expect(parsed.frameRate).toStrictEqual(7)
		expect(parsed.xOfFirstFrame).toStrictEqual(106)
		expect(parsed.yOfFirstFrame).toStrictEqual(63)

		expect(parsed.frameWidth).toStrictEqual(34)
		expect(parsed.frameHeight).toStrictEqual(37)
		expect(parsed.spaceBetweenFrames).toStrictEqual(3435973836)

		expect(parsed.frameCount).toStrictEqual(10)
		expect(parsed.name).toStrictEqual("a hen")
		expect(parsed.energy).toStrictEqual(2)
		expect(parsed.killScore).toStrictEqual(0)
		expect(parsed.maxJumpTime).toStrictEqual(20)

		expect(parsed.attackOneTime).toStrictEqual(30)
		expect(parsed.attackTwoTime).toStrictEqual(60)

		expect(parsed.bonusSprite).toStrictEqual("feather.spr")

		expect(parsed.width).toStrictEqual(30)
		expect(parsed.height).toStrictEqual(37)

		expect(parsed.canGlide).toStrictEqual(true)
		expect(parsed.isCanSwim).toStrictEqual(false)
	})
})
